import React from "react";

// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

import { Card, CardActions, CardContent, CardMedia, Grid, Typography, Container, Link,
  Paper, Box, Button } from '@material-ui/core';
import { NavLink as RouterLink, Route } from "react-router-dom";
import axios from 'axios';

import  { useStyles }  from '../../Layout/Theme/PageTheme';
import styles from "../../../assets/material/jss/material-dashboard-pro-react/views/pricingPageStyle.js";
const useStyles1 = makeStyles(styles);

export default function HomePage() {
  const classes1 = useStyles1();
  const classes = useStyles();

  const [courseList, setCourseList] = React.useState([]);

  React.useEffect(() => {
    getCourseList();
  }, []);

  const getCourseList = async () => {
    const dataList = await axios({
      url: process.env.REACT_APP_AWS_API_ENDPOINT + '/course',
      method: 'get'
    }).then(response => response.data).then((data) => {
      return data;
    });
    if(dataList) { setCourseList(dataList); }
  };

  return (
    <div className={classes1.container}>
      <>
        <CRow>
          <CCol xs="12" sm="6" md="4">
            <CCard>
              <CCardHeader>
                Introduction to Coding

              </CCardHeader>
              <CCardBody>
                Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut
                laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation
                ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat.
              </CCardBody>
            </CCard>
          </CCol>
          <CCol xs="12" sm="6" md="4">
          </CCol>
        </CRow>
      </>
    </div>
  );
}
